(lib.dustycode = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		function Particle (_shape,_speed,_fading,_lifespan) {
			this.shape = _shape;
			this.speed = _speed;
			this.fading = _fading;
			this.lifeSpan = _lifespan;
		}
		
		
		var PARTICLE_LIFESPAN_RANGE = [0.005, 0.03];
		
		function randomRange(min, max) {
		  return Math.random() * (max - min) + min;
		}
		
		var particles = [];
		
		var tickCounter = 2;
		
		var container = new createjs.Container();
		
		this.addChild(container);
		
		container.x=0;
		container.y=0;
		
		//createjs.Tween.get(container).to({alpha:1}, 400);
		
		addNewParticles();
		
		function tick(){ 
			
			tickCounter++;
			moveParticles();
			
				if(tickCounter==700)
				{
					//fadePartices();
					stopPartices();
				}
				
		}
		
		function fadePartices() {
		
			createjs.Tween.get(container).to({alpha:0}, 400).call(particlesFadeComplete);
			
		}
		
		function stopPartices() {
			
			createjs.Ticker.removeEventListener("tick", tick);
		}
		
		function particlesFadeComplete(){
			createjs.Ticker.removeEventListener("tick", tick);
			this.removeChild(container);
		}
			
		function moveParticles() {
			
			 for (var i = 0; i < particles.length; i++) {
				 particles[i].shape.x = particles[i].shape.x - (particles[i].speed * 0.5);
				 particles[i].shape.y = particles[i].shape.y - (particles[i].speed * 0.75);
				 
						 
				 if( particles[i].fading==true){
					 particles[i].shape.alpha = particles[i].shape.alpha - particles[i].lifeSpan;
					 if(particles[i].shape.alpha<0.05){
						 particles[i].fading=false;
					 }
				 }else{
					 particles[i].shape.alpha = particles[i].shape.alpha + particles[i].lifeSpan;
					 if(particles[i].shape.alpha>0.55){
						 particles[i].fading=true;
					 }
				 }
				 
				if( particles[i].shape.y < 25){
					 particles[i].shape.y = 350;			 
				 }
				 
				 if( particles[i].shape.x < -1){
					 particles[i].shape.x = 250;			 
				 }
			 }
			 
		}
		
		
		
		function addNewParticles() {
		    // if we're at our max, stop emitting.
		    //if (particles.length > maxParticles) return;
		
		    for (var i = 0; i < 200; i++) {
		           
				var rr = 255;//Math.random() * (10 - 1) + 241;
				var rg = 255;//Math.random() * (10 - 1) + 241;
				var rb = (Math.random() * (75 - 1)) + 175;
				//this.colour = 'rgb(' + Math.floor(rr) + ',' + Math.floor(rg) + ',0)';
		
				var speed = (Math.random() * (5 - 1)) * 0.25;
				
				var g = new createjs.Graphics();
				
				var radi = (Math.random() * (3 - 1)) * 0.35;
		
						
				if(i % 20 === 0){
					radi = 1.0;
				}		
				
				g.beginFill(createjs.Graphics.getRGB(Math.floor(rr),Math.floor(rg),Math.floor(rb)));
				
				g.drawCircle(0,0,radi);
		
				var s = new createjs.Shape(g);
		
				s.alpha = Math.random() * 0.65;
				
				s.x = Math.random() * (250 - 1) + 1;
				s.y = Math.random() * (350 - 1) + 1;
		
				var lifeSpan = randomRange(PARTICLE_LIFESPAN_RANGE[0], PARTICLE_LIFESPAN_RANGE[1]);
				
				var fading = true;
				
				if(s.alpha<0.5){
					fading=false;
				}
		
				var parti = new Particle(s,speed,fading,lifeSpan);
				
				container.addChild(parti.shape);	
				
				particles.push(parti);
				
			}
		
		}
		
		
		createjs.Ticker.addEventListener("tick", tick);
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

}).prototype = p = new cjs.MovieClip();
p.nominalBounds = null;


